buildscript {    repositories {        maven { url 'https://maven.fabric.io/public' }        jcenter()    }    dependencies {        classpath 'io.fabric.tools:gradle:1.+'    }}apply plugin: 'com.android.application'apply plugin: 'io.fabric'repositories {    maven { url 'https://maven.fabric.io/public' }}android {    compileSdkVersion 23    buildToolsVersion "23.0.3"    defaultConfig {        applicationId "com.tastingroomdelmar.TastingRoomDelMar"        minSdkVersion 16        targetSdkVersion 23        versionCode 6        versionName "1.0.6"    }    buildTypes {        release {            minifyEnabled false            proguardFiles getDefaultProguardFile('proguard-android.txt'), 'proguard-rules.pro'        }    }}dependencies {    compile fileTree(dir: 'libs', include: ['*.jar'])    testCompile 'junit:junit:4.12'    compile('com.crashlytics.sdk.android:crashlytics:2.5.5@aar') {        transitive = true;    }    compile('com.stripe:stripe-android:1.0.4@aar') {        transitive = true;    }    compile 'com.android.support:appcompat-v7:23.3.0'    compile 'com.android.support:support-v4:23.3.0'    compile 'com.android.support:design:23.3.0'    compile 'com.facebook.android:facebook-android-sdk:4.7.0'    compile 'com.parse:parsefacebookutils-v4-android:1.10.3@aar'    compile 'com.parse.bolts:bolts-android:1.+'    compile 'com.parse:parse-android:1.+'    compile 'org.lucasr.twowayview:twowayview:0.1.4'    compile 'com.baoyz.swipemenulistview:library:1.3.0'    compile 'org.adw.library:discrete-seekbar:1.0.1'    compile 'io.card:android-sdk:5.3.4'}